import React from 'react';
import {
  ChakraProvider,
  Box,
  Text,
  Link,
  VStack,
  Code,
  Grid,
  Container,
  extendTheme,
} from '@chakra-ui/react';

const colors = {
  op: {
    900: '#A7C4D8',
    800: '#356FB0',
    700: '#336AAC',
    600: '#5FBDF4',
  },
};

const theme = extendTheme({ colors });

function App() {
  return <ChakraProvider theme={theme}></ChakraProvider>;
}

export default App;
